@JDejenkins sheet music or lyric sheet. -
Video is a medium whereby we can observe an event in action. Photograph is static, but spurs the memory of an event.
Song (as it is sung, I assume) lets us experience music in action. Sheet music is static, yet it can prompt the memory of a song.

